	offset = 32;
	connectx4lx_pddr_monitor_opcode_pddr_advanced_opcode_auto_pack(&(ptr_struct->status_opcode), ptr_buff + offset/8);

	offset = 80;
	adb2c_push_bits_to_buff(ptr_buff, offset, 16, (u_int32_t)ptr_struct->user_feedback_index);

