void connectx4lx_pcie_phy_uc_config_pack(const struct connectx4lx_pcie_phy_uc_config *ptr_struct, u_int8_t* ptr_buff)
{
	u_int32_t offset;
	int i = 0;
	(void)offset;
	(void)i;
	(void)ptr_struct;
	(void)ptr_buff;

	offset = 0;
	connectx4lx_pcie_subroutines_db_pack(&(ptr_struct->subroutines), ptr_buff + offset/8);

	offset = 276;
	adb2c_push_bits_to_buff(ptr_buff, offset, 12, (u_int32_t)ptr_struct->total_num_of_commands);

	offset = 264;
	adb2c_push_bits_to_buff(ptr_buff, offset, 12, (u_int32_t)ptr_struct->commands_start_line_in_db);

	offset = 288;
	connectx4lx_itoc_param_pack(&(ptr_struct->part_type_phy_uc_commands), ptr_buff + offset/8);

}

void connectx4lx_pcie_phy_uc_config_unpack(struct connectx4lx_pcie_phy_uc_config *ptr_struct, const u_int8_t* ptr_buff)
{
	u_int32_t offset;
	int i = 0;
	(void)offset;
	(void)i;
	(void)ptr_struct;
	(void)ptr_buff;

	offset = 0;
	connectx4lx_pcie_subroutines_db_unpack(&(ptr_struct->subroutines), ptr_buff + offset/8);

	offset = 276;
	ptr_struct->total_num_of_commands = (u_int16_t)adb2c_pop_bits_from_buff(ptr_buff, offset, 12);

	offset = 264;
	ptr_struct->commands_start_line_in_db = (u_int16_t)adb2c_pop_bits_from_buff(ptr_buff, offset, 12);

	offset = 288;
	connectx4lx_itoc_param_unpack(&(ptr_struct->part_type_phy_uc_commands), ptr_buff + offset/8);

}

