void connectx4lx_boards_management_pack(const struct connectx4lx_boards_management *ptr_struct, u_int8_t* ptr_buff)
{
	u_int32_t offset;
	int i = 0;
	(void)offset;
	(void)i;
	(void)ptr_struct;
	(void)ptr_buff;

	offset = 31;
	adb2c_push_bits_to_buff(ptr_buff, offset, 1, (u_int32_t)ptr_struct->compliance_codes_cable_stamping_disable);

	offset = 30;
	adb2c_push_bits_to_buff(ptr_buff, offset, 1, (u_int32_t)ptr_struct->edr_cable_stamping_disable);

	offset = 29;
	adb2c_push_bits_to_buff(ptr_buff, offset, 1, (u_int32_t)ptr_struct->edr20_cable_stamping_disable);

	offset = 28;
	adb2c_push_bits_to_buff(ptr_buff, offset, 1, (u_int32_t)ptr_struct->fdr10_cable_stamping_disable);

	offset = 27;
	adb2c_push_bits_to_buff(ptr_buff, offset, 1, (u_int32_t)ptr_struct->ib_nbl_cable_stamping_disable);

	offset = 26;
	adb2c_push_bits_to_buff(ptr_buff, offset, 1, (u_int32_t)ptr_struct->eth_100g_cable_stamping_disable);

	offset = 25;
	adb2c_push_bits_to_buff(ptr_buff, offset, 1, (u_int32_t)ptr_struct->eth25g_sfp_cable_stamping_disable);

	offset = 24;
	adb2c_push_bits_to_buff(ptr_buff, offset, 1, (u_int32_t)ptr_struct->eth_mlx_phy_speeds_cable_stamping_disable);

	offset = 23;
	adb2c_push_bits_to_buff(ptr_buff, offset, 1, (u_int32_t)ptr_struct->eth_nbl_cable_stamping_disable);

	offset = 22;
	adb2c_push_bits_to_buff(ptr_buff, offset, 1, (u_int32_t)ptr_struct->lr4_40g_long_range_stamping_override);

	offset = 20;
	adb2c_push_bits_to_buff(ptr_buff, offset, 2, (u_int32_t)ptr_struct->sw_health_init_val);

	offset = 18;
	adb2c_push_bits_to_buff(ptr_buff, offset, 2, (u_int32_t)ptr_struct->osc_input_buffer);

	offset = 17;
	adb2c_push_bits_to_buff(ptr_buff, offset, 1, (u_int32_t)ptr_struct->en_aoc_no_fec_report_override);

	offset = 16;
	adb2c_push_bits_to_buff(ptr_buff, offset, 1, (u_int32_t)ptr_struct->lr4_100g_long_range_stamping_override);

	offset = 15;
	adb2c_push_bits_to_buff(ptr_buff, offset, 1, (u_int32_t)ptr_struct->module_temp_report_en);

	offset = 9;
	adb2c_push_bits_to_buff(ptr_buff, offset, 6, (u_int32_t)ptr_struct->num_of_sfp_module);

	offset = 32;
	connectx4lx_jtag_ini_pack(&(ptr_struct->jtag), ptr_buff + offset/8);

	offset = 96;
	connectx4lx_i2c_devices_smbus_slv_ix_pack(&(ptr_struct->i2c_devices_smbus_slv_ix), ptr_buff + offset/8);

	offset = 160;
	connectx4lx_power_supply_monitoring_pack(&(ptr_struct->power_supply_monitoring), ptr_buff + offset/8);

	offset = 192;
	connectx4lx_enforce_pn_list_st_pack(&(ptr_struct->enforce_pn_list), ptr_buff + offset/8);

	offset = 607;
	adb2c_push_bits_to_buff(ptr_buff, offset, 1, (u_int32_t)ptr_struct->rate_select_control_en);

	offset = 606;
	adb2c_push_bits_to_buff(ptr_buff, offset, 1, (u_int32_t)ptr_struct->rs_stick_high);

	for (i = 0; i < 12; i++) {
	offset = adb2c_calc_array_field_address(632, 8, i, 896, 1);
	adb2c_push_bits_to_buff(ptr_buff, offset, 8, (u_int32_t)ptr_struct->spare_part[i]);
	}

	for (i = 0; i < 24; i++) {
	offset = adb2c_calc_array_field_address(728, 8, i, 896, 1);
	adb2c_push_bits_to_buff(ptr_buff, offset, 8, (u_int32_t)ptr_struct->product_id[i]);
	}

}

